FeedPackage.ReleaseNotes:
1. Removed dependency on `System.Configuration.dll` (no longer supported configuration by using the `Web.config` and `App.config` files);
2. Added support of .NET Framework 4.5.1;
3. Jurassic was updated to version of September 19, 2016.

1. Removed dependency on `System.Configuration.dll` (no longer supported configuration by using the `Web.config` and `App.config` files);
2. Added support of .NET Core 1.0.1 (only supported `ChakraIeJsRt` and `ChakraEdgeJsRt` modes) and .NET Framework 4.5.1;
3. Added support of MSIE JavaScript Engine version 2.0.0.

1. Added support of .NET Core 1.0.3;
2. Downgraded .NET Framework version from 4.5.1 to 4.5;
3. Added support of MSIE JavaScript Engine version 2.1.0.

1. Removed dependency on `System.Configuration.dll` (no longer supported configuration by using the `Web.config` and `App.config` files);
2. Added support of .NET Framework 4.5.1;
3. Microsoft ClearScript.V8 was updated to version 5.4.7 (support of V8 version 5.3.332.45);
4. In configuration settings of the V8 JS engine was changed type of `DebugPort` property from `int` to `ushort`.

